import React from 'react'
import { NavLink, Outlet } from 'react-router-dom'

export const Product = () => {
  return (
    <>
    <nav className='prod'>
        <NavLink to="./saree">Saree</NavLink>
        <NavLink to="./west_tern">West-tern</NavLink>
    </nav>
    <Outlet/>
    </>
  )
}
